import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Importando o React Router
import Navbar from './pages/navbar/Navbar'; // Importando o Navbar
import Home from './componentes/Home/Home'; // Página Home
import SobreEmpresa from './componentes/SobreEmpresa/SobreEmpresa'; // Página Sobre a Empresa
import Servicos from './componentes/Servicos/Servicos'; // Página de Serviços
import Projetos from './componentes/Projetos/Projetos'; // Página de Projetos
import Contato from './componentes/Contato/Contato'; // Página de Contato
import HomePortfolio from './componentes/Portfolio/HomePortfolio/HomePortfolio'; // Página Home Portfólio
import SobreMim from './componentes/Portfolio/SobreMim/SobreMim'; // Página Sobre Mim
import CompetenciaPortfolio from './componentes/Portfolio/CompetenciaPortfolio/CompetenciaPortfolio'; // Página Competências
import ProjetosPortfolio from './componentes/Portfolio/ProjetosPortfolio/ProjetosPortfolio'; // Página Projetos Portfólio
import ContatoPortfolio from './componentes/Portfolio/ContatoPortfolio/ContatoPortfolio'; // Página Contato Portfólio

function App() {
    return (
        <Router>
            {/* Menu de navegação fixo no topo */}
            <Navbar />

            {/* Definindo as rotas para cada página */}
            <Routes>
                <Route path="/home" element={<Home />} />
                <Route path="/sobreEmpresa" element={<SobreEmpresa />} />
                <Route path="/servicos" element={<Servicos />} />
                <Route path="/projetos" element={<Projetos />} />
                <Route path="/contato" element={<Contato />} />
                <Route path="/homePortfolio" element={<HomePortfolio />} />
                <Route path="/sobreMim" element={<SobreMim />} />
                <Route path="/competenciaPortfolio" element={<CompetenciaPortfolio />} />
                <Route path="/projetosPortfolio" element={<ProjetosPortfolio />} />
                <Route path="/contatoPortfolio" element={<ContatoPortfolio />} />
            </Routes>
        </Router>
    );
}

export default App;


